    false,nt"url": null,nt"notes": "Canada geese, black ducks, mallards, and
    blue-winged teal are the primary waterfowl species that nest on Parker River National
    Wildlife Refuge. Black ducks and Canada geese winter on and around the refuge. In
    recent years, there have been outbreaks of lead poisoning in Canada geese on the
    refuge. The purpose of the Parker River NWR Migratory Bird Disease Contingency Plan
    is to establish administrative and field guidelines to properly respond to migratory
    bird disease outbreaks at this station and on adjacent wildlife management areas.
    This plan will assist in early detection and quick response to disease outbreaks
    and will hopefully reduce losses of affected species. The plan provides notification
    procedures and establishes specific responsibilities for station personnel when
    responding to a disease outbreak.",nt"license_title": "License Not Specified",nt"extras":
